import React, { Component } from 'react';

class Bricks extends Component {
    constructor(props) {
      super(props);
      this.state = {};
    }

    render() { 
      const {left, top} = this.props
      const brickSize = {
         width:`50px`,
         height:`10px`,
         backgroundColor:'Tan',
         position:'relative',
      }  
      return (
        <div>
          <span style={{...brickSize ,top:top, left:left}}></span>
        </div>
      );
    }
  }


export default Bricks;
